import React from "react"
import Logo from "../noImage.jpg"
import { BrowserRouter as Router,Routes, Route, Link } from 'react-router-dom';
import UploadP from "./UploadP";
import Home from "./Home";
import About from "./About";


export default function Header() {
    return (
        <div className="space">

        <Router> 
        
        <ul className="nav-items">
                <li style={{marginRight:"50%"}}> <Link to="/">Home</Link></li>
                <li style={{marginRight:"15%"}}> <Link to="/upload">Upload</Link></li>
                <li style={{marginRight:"15%"}}> <Link to="/about">About</Link></li>
                <li> <Link to="/"><img src={Logo} className="nav-logo" alt="logo image"/></Link></li>
            </ul>
            <Routes>
                <Route exact path='/' element={< Home />}></Route>
                <Route exact path='/about' element={< About />}></Route>
                <Route exact path='/upload' element={< UploadP />}></Route>
            </Routes>
        </Router>
        </div>

    )
}
